import React, { useState } from "react";
import Navbar from "./components/NavBar/navbar";
import Intro from "./components/intro/intro";


function App() {
  const [modal, setModal] = useState(false);

  const toggleModal = () => {
    setModal(!modal);
  };


  return (
    <div className="App">
      <Navbar />
      <Intro />

    </div>
  );
}

export default App;
